import React from 'react';

import { Container, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <Container>
        <Row>
          <Col md={6}>
            <h4>Chazzy</h4>
          </Col>
          <Col md={6}>
            <h4>Chazzy</h4>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
